import { NavBar } from './components/NavBar'
import AppRoutes from './AppRoutes';
import { Component, ReactNode } from 'react';


class App extends Component{
  componentDidMount(): void {
    let headers = new Headers();

    headers.append('Content-Type', 'application/json');
    headers.append('Accept', 'application/json');
    headers.append('Origin','http://localhost:3000');
    headers.append('Access-Control-Allow-Origin', 'http://localhost:3000');
    headers.append('Access-Control-Allow-Credentials', 'true');

    fetch("https://oauth.vk.com/access_token?client_id=51483485&client_secret=7d70138d7d70138d7d70138d777e6180d077d707d70138d1ef0e7bf8114ed0f959527ce&redirect_uri=http://localhost:3000/afterlogin&code=f7s8d7fds897gh",
    {mode: 'no-cors',
    credentials: 'include',
    method: 'GET',
    headers: headers}).
    then(Response => console.log(Response.json.toString));
  }

  render(): ReactNode {
    return (
        <div className='font'>
          <NavBar/>
          <AppRoutes/>
        </div>
      )
  }
}

export default App;
